  return (
    <div className="layout">
      <CustomHead />

      {/*NavBar*/}  Q
      <Navbar />
      {/* App Content*/}
      <style jsx>
        {`
          .layout {
            display: flex;
            width: 100%;
            height: 100vh;
            background-color: var(--color-dim-white);
          }
        `}
      </style>
      <div className="app-content">{props.children}</div>
    </div>
  );
}

export default Layout;
